const TailwindIcon = () => (
  <div className="flex flex-wrap justify-center gap-3 mb-4">
                {project.tech.map((tech, index) => (
                  <span
                    key={index}
                    className={`px-3 py-1 text-md ${tech.class} rounded-3xl flex items-center gap-2`}
                  >
                    {tech.icon} {/* Renderiza el componente del icono directamente */}
                    {tech.name} {/* Nombre de la tecnolog√≠a */}
                  </span>
                ))}
              </div>
);

